CREATE TABLE `Plantilla_json_node` (
  `id_json_node` int NOT NULL AUTO_INCREMENT COMMENT 'identificador',
  `id_json_api` int NOT NULL COMMENT 'identificador de la tabla Plantilla_json_api',
  `node_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'clave del json Comviva',
  `node_value` text CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci COMMENT 'valor default de la clave del json Comviva',
  `parent_node_id` int DEFAULT NULL COMMENT 'identificador del padre',
  `node_level` int NOT NULL COMMENT 'nivel de jerarqu√≠a en el json',
  `id_json_type` int NOT NULL COMMENT 'identificado de la tabla Plantilla_json_type, tipo de datos del valor',
  PRIMARY KEY (`id_json_node`),
  KEY `document_id` (`id_json_api`),
  KEY `parent_node_id` (`parent_node_id`),
  KEY `type_id` (`id_json_type`),
  CONSTRAINT `Plantilla_json_node_ibfk_1` FOREIGN KEY (`id_json_api`) REFERENCES `Plantilla_json_api` (`id_json_api`),
  CONSTRAINT `Plantilla_json_node_ibfk_2` FOREIGN KEY (`parent_node_id`) REFERENCES `Plantilla_json_node` (`id_json_node`),
  CONSTRAINT `Plantilla_json_node_ibfk_3` FOREIGN KEY (`id_json_type`) REFERENCES `Plantilla_json_type` (`id_json_type`)
) ENGINE=InnoDB AUTO_INCREMENT=1322 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci


